import React from 'react'
import {Grid} from '@material-ui/core'
import HeaderBar from '../_components/_appBars/headerBar'



interface IProps{
    
}

const PageLayout: React.FC<IProps> = (props) => {

    const {children} = props


    return(
        <Grid
            container>
            <Grid
                item
                xs={12}
                sm={12}
                md={12}
                lg={12}
                xl={12}>
                 <HeaderBar/>
            </Grid>
            <Grid
                item
                xs={12}>
                {children}
            </Grid>
            
        </Grid>
    )
}

export default PageLayout;
